/*Table structure for table `tb_modem` */

CREATE TABLE `tb_modem` (
  `id_modem` int(10) NOT NULL AUTO_INCREMENT,
  `nama_modem` varchar(50) NOT NULL,
  `nomor` varchar(50) NOT NULL,
  `direktori` varchar(255) NOT NULL,
  `port` varchar(50) NOT NULL,
  `connection` varchar(50) NOT NULL,
  `pin` varchar(20) NOT NULL,
  `is_default` int(3) NOT NULL DEFAULT '2' COMMENT '1=default;2=tidak',
  `cek_pulsa` varchar(50) DEFAULT NULL,
  `nomor_balas` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id_modem`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

