/* Trigger structure for table `inbox` */

DELIMITER $$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `inbox_parse` AFTER INSERT ON `inbox` FOR EACH ROW BEGIN
	DECLARE inohp VARCHAR(20);
	DECLARE ipesan VARCHAR(1000);
	DECLARE iwaktu DATETIME;
	DECLARE iid INT(10);
	DECLARE cur_pos INT DEFAULT 1;
	DECLARE stxt TEXT;
	DECLARE cur_string VARCHAR(1000);
	DECLARE pemisah_length TINYINT UNSIGNED;
	DECLARE pemisah CHAR(1);
	declare error_text VARCHAR(255);
	DECLARE error_text2 varchar(255);	
	DECLARE is_op2 int;
	DECLARE is_op_data2 INT;
	declare id_op int;
	
	DECLARE parameter2 CHAR(100);
	DECLARE value_parameter CHAR(100);
	DECLARE head_query2 CHAR(100);
	DECLARE database2 CHAR(100);
	DECLARE table2 CHAR(100);
	DECLARE id_operasi2 CHAR(100);
	DECLARE id_host2 CHAR(100);
	DECLARE id_jenis_operasi2 CHAR(100);
	DECLARE query_string CHAR(100);
	DECLARE query_string2 CHAR(100);
	DECLARE query_keluaran TEXT;
	
	DECLARE penanda_parameter2 INT;
	
	declare query_output text;
	DECLARE query_output_sms TEXT;
	DECLARE output_smsnya TEXT;
	DECLARE output_smsnya2 TEXT;
	DECLARE output_smsnya3 TEXT;
	declare outputnya text;
	declare id_output2 int;
	DECLARE last_id_output2 INT;
	
	DECLARE is_valid_keyword INT;
	declare is_publiknya int(3);	
	
	DECLARE query_join TEXT;
	DECLARE joinnya TEXT;
	DECLARE id_join2 INT;
	DECLARE last_id_join2 INT;
	DECLARE penanda_join INT;	
	
	DECLARE query_tabel TEXT;
	DECLARE tabelnya TEXT;
	DECLARE id_tabel2 INT;
	DECLARE last_id_tabel2 INT;
	DECLARE penanda_tabel INT;	
	
	DECLARE query_parameter TEXT;
	DECLARE query_parameter_val TEXT;
	DECLARE query_parameter_info TEXT;
	DECLARE parameternya TEXT;
	DECLARE parameternya2 TEXT;
	declare type_parameternya varchar(6);
	declare jumlah_parameter_asli int;
	DECLARE jumlah_parameter int;
	declare jml_key_param int;
	declare jml_val_param int;
	DECLARE id_parameter2 INT;
	DECLARE last_id_parameter2 INT;
	DECLARE penanda_parameter INT;
	DECLARE penanda_key_param INT;
	DECLARE penanda_val_param INT;
	declare is_key_param int;
	declare id_jenis_sql2 int;
	DECLARE cek_is_op INT;	
	DECLARE cek_is_op_no varchar(255);
	
	DECLARE is_foward INT;	
	DECLARE is_foward_no VARCHAR(255);
	
	DECLARE bcounter INT(1);
	DECLARE temp_bcounter INT(1);
	
	DECLARE broadcast_kw CHAR(100);
	DECLARE broadcast_kw_length INT;
	DECLARE broadcast_norm CHAR(100);
	DECLARE broadcast_norm_length INT;
	DECLARE broadcast_grup CHAR(100);
	declare broadcast_grup_start int;
	DECLARE is_broadcast CHAR(100);
	
	SET inohp = New.SenderNumber;
	SET ipesan = New.TextDecoded;
	SET iwaktu = NOW();
	SET iid = New.ID;
	SET stxt = ipesan;
	
	-- remote
	IF LEFT(stxt,5) = 'RE_OP' THEN -- remote
		SET pemisah = SUBSTRING(stxt,6,1);
	ELSE
		SET pemisah = (SELECT char_pemisah FROM tb_option LIMIT 1);
	END IF;
	SET pemisah_length = CHAR_LENGTH(pemisah);
	
	-- check if broadcast
	SET broadcast_grup = "";
	SET is_broadcast = "0";
	-- keyword
	set broadcast_kw = (SELECT keyword_broadcast FROM tb_option LIMIT 1);
	set broadcast_kw_length = CHAR_LENGTH(broadcast_kw);
	set broadcast_norm = (SELECT normal_broadcast FROM tb_option LIMIT 1);
	set broadcast_norm_length = CHAR_LENGTH(broadcast_norm);
	
	IF LEFT(stxt,broadcast_kw_length) = broadcast_kw then -- broadcast keyword
		SET is_broadcast = "1";
		SET broadcast_grup = (SELECT LEFT(REPLACE(stxt,CONCAT(broadcast_kw,pemisah),""),INSTR(REPLACE(stxt,CONCAT(broadcast_kw,pemisah),""),pemisah)-1));
		SET stxt = (SELECT REPLACE(stxt,CONCAT(broadcast_kw,pemisah,broadcast_grup,pemisah),""));
	elseIF LEFT(stxt,broadcast_norm_length) = broadcast_norm THEN -- broadcast normal
		SET is_broadcast = "2";
		SET broadcast_grup = (SELECT LEFT(REPLACE(stxt,CONCAT(broadcast_norm,pemisah),""),INSTR(REPLACE(stxt,CONCAT(broadcast_norm,pemisah),""),pemisah)-1));
		SET stxt = (SELECT REPLACE(stxt,CONCAT(broadcast_norm,pemisah,broadcast_grup,pemisah),""));
	end if;
	--
	
	
	if is_broadcast = "2" then
		INSERT INTO tb_eksekusi_respon(id_sms,output_sms,is_broadcast,broadcast_grup) VALUES(iid,stxt,is_broadcast,broadcast_grup);
	else
		SET bcounter = 0;
		SET jumlah_parameter = (SELECT LENGTH(stxt)-LENGTH(REPLACE(stxt,pemisah,'')));
		SET query_keluaran = "";
		SET query_parameter = "";
		SET query_parameter_val = "";
		
		SET query_output = "";
		SET last_id_output2 = 0	;
		
		SET query_tabel = "";
		SET last_id_tabel2 = 0	;
		
		SET query_join = "";
		SET last_id_join2 = 0	;	
		SET penanda_key_param = 1;
		SET penanda_val_param = 1;
		SET error_text="Error : ";
		
		SET is_op2 = 0;
		SET cek_is_op = 0;
		WHILE CHAR_LENGTH(stxt) > 0 AND cur_pos > 0 AND error_text="Error : " DO
			SET cur_pos = INSTR(stxt, pemisah);
			IF cur_pos = 0 THEN
				SET cur_string = stxt;
			ELSE
				SET cur_string = LEFT(stxt, cur_pos - 1);
			END IF;
			-- SET cur_string = TRIM(REPLACE(cur_string," ",""));	
			
			IF TRIM(cur_string) != '' THEN
				IF bcounter = '0' THEN
					IF cur_string = 'OP' THEN
						IF jumlah_parameter > 1 THEN
							SET is_op2 = 1;
							
							SET cek_is_op = (SELECT COUNT(*) FROM tb_host WHERE no_hp=inohp);
							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET cur_pos = INSTR(stxt, pemisah);
							SET cur_string = LEFT(stxt, cur_pos - 1);
							SET cur_string = TRIM(REPLACE(cur_string," ",""));
							SET id_op = cur_string;
							
							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET jumlah_parameter = (SELECT LENGTH(stxt)-LENGTH(REPLACE(stxt,pemisah,'')));	
							
							SET cur_pos = INSTR(stxt, pemisah);
							IF cur_pos = 0 THEN
								SET cur_string = stxt;
							ELSE
								SET cur_string = LEFT(stxt, cur_pos - 1);
							END IF;
							SET cur_string = TRIM(REPLACE(cur_string," ",""));			
						END IF;
					ELSEIF cur_string = 'RE_OP' THEN
						IF jumlah_parameter > 1 THEN
							SET is_op_data2 = 1;
							
							SET cek_is_op = (SELECT COUNT(*) FROM tb_host WHERE no_hp=inohp);						
							
							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET cur_pos = INSTR(stxt, pemisah);
							SET cur_string = LEFT(stxt, cur_pos - 1);
							SET cur_string = TRIM(REPLACE(cur_string," ",""));
							SET id_op = cur_string;
							
							SET query_keluaran = SUBSTRING(stxt, cur_pos + pemisah_length);
						END IF;
					ELSEIF cur_string = 'FOWARD' THEN
						IF jumlah_parameter > 1 THEN
							SET is_foward = 1;
							
							SET cek_is_op = (SELECT COUNT(*) FROM tb_host WHERE no_hp=inohp);
							
							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET cur_pos = INSTR(stxt, pemisah);
							SET cur_string = LEFT(stxt, cur_pos - 1);
							SET cur_string = TRIM(REPLACE(cur_string," ",""));
							SET inohp = cur_string;
							
							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET jumlah_parameter = (SELECT LENGTH(stxt)-LENGTH(REPLACE(stxt,pemisah,'')));	
							
							SET cur_pos = INSTR(stxt, pemisah);
							IF cur_pos = 0 THEN
								SET cur_string = stxt;
							ELSE
								SET cur_string = LEFT(stxt, cur_pos - 1);
							END IF;
							SET cur_string = TRIM(REPLACE(cur_string," ",""));			
						END IF;
					END IF;
					
					IF is_op_data2 = 1 THEN
						SET error_text = CONCAT(error_text,"Reply dari OP");
					ELSE
						SET is_valid_keyword = (SELECT COUNT(id_operasi) FROM tb_operasi,tb_host WHERE tb_operasi.id_host = tb_host.id_host AND keyword=cur_string AND tb_host.is_local='1' LIMIT 1);
						
						IF is_valid_keyword = '0' THEN
							SET error_text = CONCAT(error_text,"SMS SPAM");
							SET error_text2 = "Keyword tidak ditemukan";
						ELSE
							SET id_operasi2 = (SELECT id_operasi FROM tb_operasi WHERE keyword=cur_string LIMIT 1);
							SET is_publiknya = (SELECT is_publik FROM tb_operasi WHERE id_operasi=id_operasi2);
							IF is_publiknya = '1' THEN
								SET id_jenis_operasi2 = (SELECT id_jenis_operasi FROM tb_operasi WHERE id_operasi=id_operasi2 LIMIT 1);
								SET id_host2 = (SELECT id_host FROM tb_operasi WHERE id_operasi=id_operasi2 LIMIT 1);
								SET database2 = (SELECT db FROM tb_host WHERE id_host=id_host2 LIMIT 1);
